import React from 'react';
import CourseListApp from './CourseListApp';
import Container from 'react-bootstrap/Container'

function CourseChecklist() {
    var course1 = "CSE 1105 Introduction to CSE";
    var course2 = "CSE 1320 Intermediate Programming";
    var course3 = "CSE 1325 Object-Oriented Programming";

    var AllCourses = [course1, course2, course3];

    return (
      <div className="CourseChecklist">
        <Container>
            <CourseListApp initCourses={AllCourses}/>
        </Container>

      </div>
    );
  }

  export default CourseChecklist;
